-- ----------------------------
-- Table structure for xxl_job_log
-- ----------------------------
DROP TABLE IF EXISTS `xxl_job_log`;
CREATE TABLE `xxl_job_log`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `job_group` int(11) NOT NULL COMMENT 'actuatorprimary keyID',
  `job_id` int(11) NOT NULL COMMENT 'Task，primary keyID',
  `executor_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'actuatoraddress，The address of this execution',
  `executor_handler` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'actuatorTaskhandler',
  `executor_param` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'actuatorTaskparameter',
  `executor_sharding_param` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'actuatorTask分片parameter，The format is like 1/2',
  `executor_fail_retry_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Number of failed retries',
  `trigger_time` datetime NULL DEFAULT NULL COMMENT 'Scheduling-time',
  `trigger_code` int(11) NOT NULL COMMENT 'Scheduling-result',
  `trigger_msg` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'Scheduling-log',
  `handle_time` datetime NULL DEFAULT NULL COMMENT 'implement-time',
  `handle_code` int(11) NOT NULL COMMENT 'implement-state',
  `handle_msg` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'implement-log',
  `alarm_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Alarmstate：0-default、1-No need to warn、2-Alarm successful、3-Alarm failed',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `I_trigger_time`(`trigger_time`) USING BTREE,
  INDEX `I_handle_code`(`handle_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6761 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

