-- Table structure for xxl_job_log_report
-- ----------------------------
DROP TABLE IF EXISTS `xxl_job_log_report`;
CREATE TABLE `xxl_job_log_report`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trigger_day` datetime NULL DEFAULT NULL COMMENT 'Scheduling-time',
  `running_count` int(11) NOT NULL DEFAULT 0 COMMENT 'runmiddle-logquantity',
  `suc_count` int(11) NOT NULL DEFAULT 0 COMMENT 'implementsuccess-logquantity',
  `fail_count` int(11) NOT NULL DEFAULT 0 COMMENT 'implementfail-logquantity',
  `update_time` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `i_trigger_day`(`trigger_day`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

